def change_colors(input: List[List[int]], colors: Dict[int, int]) -> List[List[int]]:
    for i in range(len(input)):
        for j in range(len(input[0])):
            if input[i][j] in colors:
                input[i][j] = colors[input[i][j]]
    return input

